import React from 'react';
import {sum,sub,mult,divi} from './Calc';

function App(){
    return (
        <> 
        <li>{ sum() }</li>
        <li>{ sub() }</li>
        <li>{ mult() }</li>
        <li>{ divi() }</li>
        </>
    )
}


export default App;
